import './Admin.css'
 


export default function loginAdmin(){

    return(

        <>
        <div className=''> 
        <div className='login'>
    
    <h1>Login</h1>
   <input type='text' placeholder='Enter your userName' />
   <input type='password' placeholder='Enter your password' />
       
       <div className='button'>Login</div>
       
       </div>
      
     </div>
        </>
    )
}
